id:1,
name:'Slate & Crystal Events',
description:'abc',
location:'Switzerland'

},
{
    id:2,
    name :'Indigo Event Planning',
    description:'xyz',
    location:'kalyan'
    
    },
    {
        id:3,
        name:'Buttercup Events',
        description:'pqr',
        location:'Paris'
        
        }
]
};
}

    render() {
        const {events} =this.state;
        return (
            <div>
                {events.map(event =>(

                    <Event name={Event.name} description={Event.description} location={Event.location}/>
                ))}
            </div>
        );
    }
}

export default Events;
